import React from 'react';
// import CaseImages from '.../CaseImages';

export default function CaseStudyCard(props) {
    return (
        <div className="flex justify-center px-10">
            <img className="rounded-sm pb-2" src={props.image} alt={props.alt}/>
            <div className="space-y-4">
                <h3 className="text-left text-white font-usual">{props.header}</h3>
            </div>
        </div>
        )
};
